const scheduleData = [
	{
		name: "Monday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	},
	{
		name: "Tuesday",
		hours: [
			{course: "Calculus", hour: 1},
			{course: "Physics", hour: 2}
		]
	}
];

const Schedule = () => {
	return (
		<ContentPage title="Schedule">
			<div className="flex flex-row justify-center border-2 border-red-500">
				{scheduleData.map(day => <Day day={day} /> )}
			</div>
		</ContentPage>
	);
}

